    public static int lengthOfLongestSubstring(String s) {
        int l = 0,r = 0;
        HashSet<Character> set = new HashSet<>();
        int res = 0;

        while(r < s.length()){  // 0<7    1<7   1<7     2<7     3<7     4<7
            if(!set.contains(s.charAt(r))){ //
                set.add(s.charAt(r)); // set[a] set[a]  set[ab]  set[abe]
                r++; // r=1 r=2 r=3   r=4
                res = Math.max(res,r-l); // res=1 res=1 res=2  res=3
            }
            else{
                set.remove(s.charAt(l)); // set[]   set[be]
                l++; // l=1  l=2
            }
        }

        return res;
    }
